import React from "react"

let btnNotClicked = true
const Table = props => {
  // const [bookingList, setBookingList] = useState([])

  // setBookingList(bookingList.concat(props.values))

  const clickHandle = () => {
    // alert("yes")
    let btnNotClicked = false
  }
  return (
    <div>
      <h3>Booking List</h3>

      <table>
        <thead>
          <tr>
            <th>FirstName</th>
            <th>LastName</th>
            <th>Email</th>
            <th>Tel Number</th>
            <th>Cover</th>
            <th>Date</th>
            <th>Time</th>
            {/*  */}
            <th>seated</th>
          </tr>
        </thead>

        <tbody>
          {props.bookingList.map(value => {
            return (
              <tr className="rows">
                <td key={value}>{value.firstName}</td>
                <td key={value}>{value.lastName}</td>
                <td key={value}>{value.email}</td>
                <td key={value}>{value.telNumber}</td>
                <td key={value}>{value.cover}</td>
                <td key={value}>{value.date}</td>
                <td key={value}>{value.time}</td>
                <td key={value}> {btnNotClicked && <button onClick={clickHandle}> not arrived</button>}</td>
                <td key={value}>{!btnNotClicked && <button> seated</button>}</td>
              </tr>
            )
          })}
        </tbody>
      </table>
    </div>
  )
}

export default Table
